def min_cost(cost, m, n):
    if m == 0 or n == 0:
        return 0
    return min(min_cost(cost, m-1, n), min_cost(cost, m, n-1), min_cost(cost, m-1, n-1)) + cost[m][n]

def similar_elements(tuple_list1, tuple_list2):
    similar_elements = set()
    for element in tuple_list1:
        for element2 in tuple_list2:
            if element == element2:
                similar_elements.add(element)
    return similar_elements

def similar_elements(list1, list2):
    set1 = set(list1)
    set2 = set(list2)
    return list(set1.intersection(set2))

def is_not_prime(n):
    if n == 1:
        return False
    for i in range(2, n):
        if n % i == 0:
            return False
    return True

def is_not_prime(n):
    if n <= 1:
        return False
    for i in range(2, n):
        if n % i == 0:
            return False
    return True

def differ_At_One_Bit_Pos(a, b):
    diff = a ^ b
    pos = 0
    while diff > 0:
        if diff & 1:
            return pos
        diff >>= 1
        pos += 1
    return -1

